/lib/python3.12/site-packages/datasets/info.py", "target": "dspy-rag-system/venv/lib/python3.12/site-packages/PIL/features.py", "type": "import", "import_type": "from_import", "line": 45}, {"source": "dspy-rag-system/venv/lib/python3.12/site-packages/datasets/info.py", "target": "dspy-rag-system/venv/lib/python3.12/site-packages/datasets/splits.py", "type": "import", "import_type": "from_import", "line": 46}, {"source": "dspy-rag-system/venv/lib/python3.12/site-packages/datasets/info.py", "target": "dspy-rag-system/venv/lib/python3.12/site-packages/packaging/utils.py", "type": "import", "import_type": "from_import", "line": 49}, {"source": "dspy-rag-system/venv/lib/python3.12/site-packages/datasets/keyhash.py", "target": "dspy-rag-system/venv/lib/python3.12/site-packages/referencing/typing.py", "type": "import", "import_type": "from_import", "line": 33}, {"source": "dspy-rag-system/venv/lib/python3.12/site-packages/idna/intranges.py", "target": "dspy-rag-system/venv/lib/python3.12/site-packages/referencing/typing.py", "type": "import", "import_type": "from_import", "line": 9}, {"source": "dspy-rag-system/venv/lib/python3.12/site-packages/idna/compat.py", "target": "dspy-rag-system/venv/lib/python3.12/site-packages/referencing/typing.py", "type": "import", "import_type": "from_import", "line": 1}, {"source": "dspy-rag-system/venv/lib/python3.12/site-packages/idna/compat.py", "target": "dspy-rag-system/venv/lib/python3.12/site-packages/diskcache/core.py", "type": "import", "import_type": "from_import", "line": 3}, {"source": "dspy-rag-system/venv/lib/python3.12/site-packages/idna/__init__.py", "target": "dspy-rag-system/venv/lib/python3.12/site-packages/diskcache/core.py", "type": "import", "import_type": "from_import", "line": 1}];
        
        // Setup
        const width = document.getElementById('graph-container').offsetWidth;
        const height = 600;
        
        // Create SVG
        const svg = d3.select('#graph-container')
            .append('svg')
            .attr('width', width)
            .attr('height', height);
        
        // Create tooltip
        const tooltip = d3.select('body')
            .append('div')
            .attr('class', 'tooltip')
            .style('opacity', 0);
        
        // Create force simulation
        const simulation = d3.forceSimulation(nodes)
            .force('link', d3.forceLink(edges).id(d => d.id).distance(100))
            .force('charge', d3.forceManyBody().strength(-300))
            .force('center', d3.forceCenter(width / 2, height / 2))
            .force('collision', d3.forceCollide().radius(30));
        
        // Create links
        const link = svg.append('g')
            .selectAll('line')
            .data(edges)
            .enter().append('line')
            .attr('class', 'link')
            .attr('stroke-width', 1);
        
        // Create nodes
        const node = svg.append('g')
            .selectAll('circle')
            .data(nodes)
            .enter().append('circle')
            .attr('class', 'node')
            .attr('r', d => Math.min(20, Math.max(5, (d.imports || 0) / 2 + 5)))
            .attr('fill', d => d.imports > 10 ? '#ff6b6b' : d.imports > 5 ? '#4ecdc4' : '#45b7d1')
            .on('mouseover', function(event, d) {
                tooltip.transition()
                    .duration(200)
                    .style('opacity', .9);
                tooltip.html(`
                    <strong>${d.id}</strong><br/>
                    Imports: ${d.imports || 0}<br/>
                    Type: ${d.type || 'file'}
                `)
                    .style('left', (event.pageX + 10) + 'px')
                    .style('top', (event.pageY - 28) + 'px');
            })
            .on('mouseout', function(d) {
                tooltip.transition()
                    .duration(500)
                    .style('opacity', 0);
            })
            .call(d3.drag()
                .on('start', dragstarted)
                .on('drag', dragged)
                .on('end', dragended));
        
        // Add labels
        const label = svg.append('g')
            .selectAll('text')
            .data(nodes)
            .enter().append('text')
            .attr('class', 'label')
            .text(d => d.id.split('/').pop().replace('.py', ''))
            .attr('font-size', '10px')
            .attr('text-anchor', 'middle')
            .attr('dy', '0.35em')
            .style('pointer-events', 'none')
            .style('opacity', 0.7);
        
        // Update positions on simulation tick
        simulation.on('tick', () => {
            link
                .attr('x1', d => d.source.x)
                .attr('y1', d => d.source.y)
                .attr('x2', d => d.target.x)
                .attr('y2', d => d.target.y);
            
            node
                .attr('cx', d => d.x)
                .attr('cy', d => d.y);
            
            label
                .attr('x', d => d.x)
                .attr('y', d => d.y);
        });
        
        // Drag functions
        function dragstarted(event, d) {
            if (!event.active) simulation.alphaTarget(0.3).restart();
            d.fx = d.x;
            d.fy = d.y;
        }
        
        function dragged(event, d) {
            d.fx = event.x;
            d.fy = event.y;
        }
        
        function dragended(event, d) {
            if (!event.active) simulation.alphaTarget(0);
            d.fx = null;
            d.fy = null;
        }
        
        // Control functions
        function resetZoom() {
            simulation.alpha(1).restart();
        }
        
        function toggleLabels() {
            const labels = d3.selectAll('.label');
            const currentOpacity = labels.style('opacity');
            labels.style('opacity', currentOpacity == 0.7 ? 0 : 0.7);
        }
        
        function exportGraph() {
            const dataStr = JSON.stringify({nodes, edges}, null, 2);
            const dataBlob = new Blob([dataStr], {type: 'application/json'});
            const url = URL.createObjectURL(dataBlob);
            const link = document.createElement('a');
            link.href = url;
            link.download = 'dependency_graph.json';
            link.click();
        }
        
        // Add zoom behavior
        const zoom = d3.zoom()
            .on('zoom', (event) => {
                svg.selectAll('g').attr('transform', event.transform);
            });
        
        svg.call(zoom);
    </script>
